(1536, 'ulotki', '19.05.2014', '8:00', 'AWF', 'Ulotkowanie - Listy do M. -\r\nDrogi AIESECerze, mam do Ciebie prośbę. Napisałem list do mej lubej M. lecz zgubiłem jej adres, dlatego zrobiłem 10000 kopii mego listu. Wręcz go każdemu kogo spotkasz na swej drodze, aby ten list trafił do niej i żebym mógł ją znów odnaleźć?', '1', '1', '', ''),
(1600, 'event', '21-05-2014', '10:00', 'Stand - UEK', 'Standy - Restauracja miłosna STAND - \r\nPrzytulne miejsce, gdzie w miłej niezobowiązującej atmosferze możesz  zawrzeć nowe znajomości, zarówno te przelotne jak i te głębokie. Gorąco zachęcamy do odwiedzenia naszej miłosnej restauracji. Nie trać czasu i już dziś dokonaj rezerwacji. \r\n', '1', '1', '', ''),
